export const mapZoom: number = 12;
export const rotationStatus: boolean = false;
export const geoserverWfsUrl: string = 'http://localhost:9090/geoserver/pg/wfs?service=WFS&version=1.1.0';
export const typeName: string = 'pg:hu';
